INSERT INTO `t_blog_content` (`uid`, `content`, `status`, `create_time`, `update_time`) VALUES ('00ef773b1cb542bb8e4d262e5f23e37c','罚你登龙给怪回血',1,'2024-01-15 07:48:34','2024-01-15 07:48:34'),('1810b500225c46f4b34e6ca68b8582c0','### 原理：\n使用一个具有公网IP的主机作为服务端，想要映射的内网主机作为客户端，通过映射内网主机对应的端口到服务主机的端口，实现内网穿透\n\n\n猜想：\n\n目前知道了小米的路由器可以刷成openwrt，假如说这台路由器拥有公网ip，是不是可以实现小米路由器作为服务端\n### 工具\n[frp_0.51.3_linux_amd64.tar-20230924115050-obaqugs.gz](http://127.0.0.1:9002/pplax-blogblog/attach/2024-05-13/1715582865437.gz)\n服务端和客户端都用这个\n\n解压\n```bash\ntar -zxvf frp_....\n```\n### 服务端\n```bash\nvim frps.ini				# 修改配置\n```\n\n```ini\n[common]\nbind_port = 7000							# 代理转发的端口\ntoken = Lax_220120969						# 服务端请求转发的凭证\ndashboard_port = 7500						# 控制面板的端口\ndashboard_user = pplax						# 访问控制面板的用户名\ndashboard_pwd = Lax_220120969				# 访问控制面板的密码\n\n# 这...后面那几个注解记得删...\n```\n\n```bash\nnohup ./frps -c frps.ini				# 服务端启动\n```\n### 客户端\n客户端同理\n\n```bash\nvim frps.ini				# 修改配置\n```\n\n```ini\n[common]\nserver_addr = {公网ip}\nserver_port = 7000						# 与以上bind_port一致\ntoken = Lax_220120969					# 与以上token一致\n\n[ssh]\ntype = tcp\nlocal_ip = 127.0.0.1\nlocal_port = 2222						# 这里我设置的是2222\nremote_port = 7001						# 这个是映射到服务端的端口\n```\n\n\n有些情况会有客户端自动休眠的情况，这时就不能访问了\n\n关闭自动休眠\n\n```bash\nvim /etc/systemd/logind.conf\n```\n\n将`HandleLidSwitch=suspend`改为`HandleLidSwitch=ignore`\n\n重启主机或者是命令`sudo restart systemd-logind`\n\n### Windows\n\n与linux端同理\n[frp_0.33.0_windows_amd64-20231209114329-sdi09wa.7z](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715582951835.7z)',1,'2024-03-14 12:09:11','2024-04-14 08:12:15'),('1e1526d6259046059e3d231e63c40328','qweqweqwe',0,'2024-06-24 04:18:35','2024-06-24 03:55:37'),('2a55082075064b47998053f69c7d1dc3','```\n#设置root的口令（密码），用作后续登陆使用\nsudo passwd root\n\n#安装openssh-server（ubuntu自带已安装，但是我使用有问题，没找到原因）\nsudo apt remove openssh-server\nsudo apt install openssh-client openssh-server\n\n#备份原始的sshd_config\nsudo cp /etc/ssh/sshd_config /etc/ssh/sshd_config.bak\nsudo cp /etc/ssh/ssh_config /etc/ssh/ssh_config.bak\n\n#使用vim进行编辑，按i进入insert模式\nsudo vim /etc/ssh/sshd_config\n\n在vim中找到对应项并修改，ESC，输入`wq`保存退出：\nPort 2222\nListenAddress 0.0.0.0        # 如果需要指定监听的IP则去除最左侧的井号，并配置对应IP，默认即监听PC所有IP\nPermitRootLogin no           # 如果你需要用 root 直接登录系统则此处改为 yes\nPasswordAuthentication yes    # 将 no 改为 yes 表示使用帐号密码方式登录\n\n#使用vim进行编辑，按i进入insert模式\nsudo vim /etc/ssh/sshd_config\n\n#在vim中找到对应项并修改，ESC，输入`:wq!`强制保存退出：\nPort 2222\nListenAddress 0.0.0.0        # 如果需要指定监听的IP则去除最左侧的井号，并配置对应IP，默认即监听PC所有IP\n\n#启动ssh，查看status\nsudo service ssh start             #启动SSH服务，这个每次都得起一下，以后看看能不能开机自启\nsudo service ssh status            #检查状态\nsudo systemctl enable ssh          #开机自动启动ssh命令，我好想失效了\n```\n\nfinalshell\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-04-21/1713688994604.png)\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-04-21/1713689001089.png)\n',1,'2024-03-14 09:42:58','2024-04-14 08:12:16'),('30757ce5c7384cd6ab48d21fefd55d31','dffadsfadsadfs',0,'2024-06-24 04:22:07','2024-06-24 04:13:52'),('369bb7c69a464c4999725d9550b0c44b','qweqweqwe',0,'2024-06-24 04:18:36','2024-06-24 03:55:37'),('3d1a2672e8134e99a34828df99efe052','s![RC.jpg](http://127.0.0.1:9002/pplax-blog/blog/attach/file/2024-03-14/1710409534738.jpg)\n[开题报告.docx](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-14/1710417653763.docx)\n\nasdasdasdasdasd',0,'2024-03-14 09:44:45','2024-04-17 09:48:04'),('521e940f8e3c4233904347512a5cdf43','\n\n# 一、什么是Sentinel\n\nSentinel定位是分布式系统的流量防卫兵。目前互联网应用基本上都使用微服务，微服务的稳定性是一个很重要的问题，而**限流、熔断降级**是微服务保持稳定的一个重要的手段。\n\n下面看官网的一张图，了解一下Sentinel的主要特性：\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583148819.png)\n在Sentinel之前其实就有Hystrix做熔断降级的事情，我们都知道出现新的事物肯定是原来的东西有不足的地方。\n\n> 那Hystrix有什么不足之处呢？\n\n* Hystrix常用的线程池隔离会造成线程上下切换的overhead比较大。\n* Hystrix没有监控平台，需要我们自己搭建。\n* Hystrix支持的熔断降级维度较少，不够细粒，而且缺少管理控制台。\n\n> Sentinel有哪些组成部分？\n\n* 核心库（Java 客户端）不依赖任何框架/库，能够运行于所有 Java 运行时环境，同时对 Dubbo / Spring Cloud 等框架也有较好的支持。\n* 控制台（Dashboard）基于 Spring Boot 开发，打包后可以直接运行，不需要额外的 Tomcat 等应用容器。\n\n> Sentinel有哪些特征？\n\n* **丰富的应用场景**。控制突发流量在可控制的范围内，消息削峰填谷，集群流量控制，实时熔断下游不可用的应用等等。\n* **完备的实时监控**。Sentinel 提供实时的监控功能。您可以在控制台中看到接入应用的单台机器秒级数据，甚至 500 台以下规模的集群的汇总运行情况。\n* **广泛的开源生态**。Sentinel 提供开箱即用的与其它开源框架/库的整合模块，例如与 Spring Cloud、Dubbo、gRPC 的整合。您只需要引入相应的依赖并进行简单的配置即可快速地接入 Sentinel。\n* **完善的 SPI 扩展点**。Sentinel 提供简单易用、完善的 SPI 扩展接口。您可以通过实现扩展接口来快速地定制逻辑。例如定制规则管理、适配动态数据源等。\n\n# 二、Hello World\n\n一般要学一种没接触过的技术框架，肯定要先做个Hello World熟悉一下。\n\n> 引入Maven依赖\n\n```\n<dependency>\n    <groupId>com.alibaba.csp</groupId>\n    <artifactId>sentinel-core</artifactId>\n    <version>1.8.1</version>\n</dependency>\n```\n\n需要提醒一下，Sentinel仅支持JDK 1.8或者以上的版本\n\n> 定义规则\n\n通过定义规则来控制该资源每秒允许通过的请求次数，例如下面的代码定义了资源 `HelloWorld` 每秒最多只能通过 20 个请求。\n\n```\nprivate static void initFlowRules(){\n    List<FlowRule> rules = new ArrayList<>();\n    FlowRule rule = new FlowRule();\n    rule.setResource(\"HelloWorld\");\n    rule.setGrade(RuleConstant.FLOW_GRADE_QPS);\n    // Set limit QPS to 20.\n    rule.setCount(20);\n    rules.add(rule);\n    FlowRuleManager.loadRules(rules);\n}\n```\n\n> 编写Hello World代码\n\n其实代码编写很简单，首先需要定义一个资源entry，然后用`SphU.entry(\"HelloWorld\")`和`entry.exit()`把需要流量控制的代码包围起来。代码如下：\n\n```\npublic static void main(String[] args) throws Exception {\n    initFlowRules();\n    while (true) {\n        Entry entry = null;\n        try {\n            entry = SphU.entry(\"HelloWorld\");\n            /*您的业务逻辑 - 开始*/\n            System.out.println(\"hello world\");\n            /*您的业务逻辑 - 结束*/\n        } catch (BlockException e1) {\n            /*流控逻辑处理 - 开始*/\n            System.out.println(\"block!\");\n            /*流控逻辑处理 - 结束*/\n        } finally {\n            if (entry != null) {\n                entry.exit();\n            }\n        }\n    }\n}\n```\n\n运行结果如下：\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583175208.png)\n我们根据目录查看日志，文件名格式为${appName}-metrics.log.xxx：\n\n```\n|--timestamp-|------date time----|-resource-|p |block|s |e|rt\n1616607101000|2021-03-25 01:31:41|HelloWorld|20|11373|20|0|1|0|0|0\n1616607102000|2021-03-25 01:31:42|HelloWorld|20|24236|20|0|0|0|0|0\n```\n\n`p` 代表通过的请求。\n\n`block` 代表被阻止的请求。\n\n`s` 代表成功执行完成的请求个数。\n\n`e` 代表用户自定义的异常。\n\n`rt` 代表平均响应时长。\n\n# 三、使用Sentinel的方式\n\n下面结合实际案例，写一个Controller接口进行示范练习。\n\n```\n@RestController\n@RequestMapping(\"/user\")\npublic class UserController {\n    @Resource\n    private UserService userService;\n\n    @RequestMapping(\"/list\")\n    public List<User> getUserList() {\n        return userService.getList();\n    }\n}\n\n@Service\npublic class UserServiceImpl implements UserService {\n    //模拟查询数据库数据，返回结果\n    @Override\n    public List<User> getList() {\n        List<User> userList = new ArrayList<>();\n        userList.add(new User(\"1\", \"周慧敏\", 18));\n        userList.add(new User(\"2\", \"关之琳\", 20));\n        userList.add(new User(\"3\", \"王祖贤\", 21));\n        return userList;\n    }\n}\n```\n\n假设我们要让这个查询接口限流，怎么做呢？\n\n## 1) 抛出异常的方式\n\n`SphU` 包含了 try-catch 风格的 API。用这种方式，当资源发生了限流之后会抛出 `BlockException`。这个时候可以捕捉异常，进行限流之后的逻辑处理。\n\n```\n@RestController\n@RequestMapping(\"/user\")\npublic class UserController {\n    //资源名称\n    public static final String RESOURCE_NAME = \"userList\";\n\n    @Resource\n    private UserService userService;\n\n    @RequestMapping(\"/list\")\n    public List<User> getUserList() {\n        List<User> userList = null;\n        Entry entry = null;\n        try {\n            // 被保护的业务逻辑\n            entry = SphU.entry(RESOURCE_NAME);\n            userList = userService.getList();\n        } catch (BlockException e) {\n            // 资源访问阻止，被限流或被降级\n            return Collections.singletonList(new User(\"xxx\", \"资源访问被限流\", 0));\n        } catch (Exception e) {\n            // 若需要配置降级规则，需要通过这种方式记录业务异常\n            Tracer.traceEntry(e, entry);\n        } finally {\n            // 务必保证 exit，务必保证每个 entry 与 exit 配对\n            if (entry != null) {\n                entry.exit();\n            }\n        }\n        return userList;\n    }\n\n}\n```\n\n实际上还没写完，还要定义限流的规则。\n\n```\n@SpringBootApplication\npublic class SpringmvcApplication {\n\n    public static void main(String[] args) throws Exception {\n        SpringApplication.run(SpringmvcApplication.class, args);\n        //初始化限流规则\n        initFlowQpsRule();\n    }\n    //定义了每秒最多接收2个请求\n    private static void initFlowQpsRule() {\n        List<FlowRule> rules = new ArrayList<>();\n        FlowRule rule = new FlowRule(UserController.RESOURCE_NAME);\n        // set limit qps to 2\n        rule.setCount(2);\n        rule.setGrade(RuleConstant.FLOW_GRADE_QPS);\n        rule.setLimitApp(\"default\");\n        rules.add(rule);\n        FlowRuleManager.loadRules(rules);\n    }\n}\n```\n\n然后启动项目，测试。快速刷新几次，我们就看到触发限流的逻辑了。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583196215.png)\n## 2) 返回布尔值的方式\n\n抛出异常的方式是当被限流时以抛出异常的形式感知，我们通过捕获异常进行限流的处理，这种方式跟上面不同的在于不抛出异常，而是返回一个布尔值，我们通过判断布尔值来进行限流逻辑的处理。这样我们就可以很容易写出`if-else`结构的代码。\n\n```\npublic static final String RESOURCE_NAME_QUERY_USER_BY_ID = \"queryUserById\";\n\n@RequestMapping(\"/get/{id}\")\npublic String queryUserById(@PathVariable(\"id\") String id) {\n    if (SphO.entry(RESOURCE_NAME_QUERY_USER_BY_ID)) {\n        try {\n            //被保护的逻辑\n            //模拟数据库查询数据\n            return JSONObject.toJSONString(new User(id, \"Tom\", 25));\n        } finally {\n            //关闭资源\n            SphO.exit();\n        }\n    } else {\n        //资源访问阻止，被限流或被降级\n        return \"Resource is Block!!!\";\n    }\n}\n```\n\n添加规则的代码跟前面的例子一样，我就不写了，然后启动项目，测试。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583211498.png)\n## 3) 注解的方式\n\n看了上面两种方式，肯定有人会说，代码侵入性太强了，如果原来旧的系统要接入的话，要改原来的代码。众所周知，旧代码是不能动的，否则后果很严重。\n\n那么注解的方式就很好地解决了这个问题。注解式怎么写呢？\n\n```\n@Service\npublic class UserServiceImpl implements UserService {\n    //资源名称\n    public static final String RESOURCE_NAME_QUERY_USER_BY_NAME = \"queryUserByUserName\";\n\n    //value是资源名称，是必填项。blockHandler填限流处理的方法名称\n    @Override\n    @SentinelResource(value = RESOURCE_NAME_QUERY_USER_BY_NAME, blockHandler = \"queryUserByUserNameBlock\")\n    public User queryByUserName(String userName) {\n        return new User(\"0\", userName, 18);\n    }\n\n    //注意细节，一定要跟原函数的返回值和形参一致，并且形参最后要加个BlockException参数\n    //否则会报错，FlowException: null\n    public User queryUserByUserNameBlock(String userName, BlockException ex) {\n        //打印异常\n        ex.printStackTrace();\n        return new User(\"xxx\", \"用户名称：{\" + userName + \"},资源访问被限流\", 0);\n    }\n}\n```\n\n写完这个核心代码后，还要加个配置，否则不生效。\n\n引入`sentinel-annotation-aspectj`的Maven依赖。\n\n```\n<dependency>\n    <groupId>com.alibaba.csp</groupId>\n    <artifactId>sentinel-annotation-aspectj</artifactId>\n    <version>1.8.1</version>\n</dependency>\n```\n\n然后将`SentinelResourceAspect`注册为一个Bean。\n\n```\n@Configuration\npublic class SentinelAspectConfiguration {\n    @Bean\n    public SentinelResourceAspect sentinelResourceAspect() {\n        return new SentinelResourceAspect();\n    }\n}\n```\n\n别忘了添加规则，可以参考第一个例子，这里就不写了。\n\n最后启动项目，测试，刷新多几次接口后，出发限流，可以看到以下结果。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583229649.png)\n```\n@Override\n@SentinelResource(value = RESOURCE_NAME_QUERY_USER_BY_NAME, blockHandler = \"queryUserByUserNameBlock\", fallback = \"queryUserByUserNameFallBack\")\npublic User queryByUserName(String userName) {\n    if (userName == null || \"\".equals(userName)) {\n        //抛出异常\n        throw new RuntimeException(\"queryByUserName() command failed, userName is null\");\n    }\n    return new User(\"0\", userName, 18);\n}\n\npublic User queryUserByUserNameFallBack(String userName, Throwable ex) {\n    //打印日志\n    ex.printStackTrace();\n    return new User(\"-1\", \"用户名称：{\" + userName + \"},系统异常，请稍后重试\", 0);\n}\n```\n\n然后启动项目，故意不传userName，进行测试，可以看到走了fallback的方法逻辑。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583244720.png)\nIDEA控制台也可以看到自定义的异常信息。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583254458.png)\n# 四、管理控制台\n\n上面讲完了Sentinel的基本用法，实际上重头戏在Sentinel的管理控制台，管理控制台提供了很多实用的功能。下面我们看看怎么使用。\n\n## 下载\n\n### 一般方案\n\n首先下载控制台的jar包，当然你也可以通过下载源码编译得到。\n\n```\n//下载页面地址\nhttps://github.com/alibaba/Sentinel/releases\n```\n\n然后使用以下命令启动：\n\n```\njava -Dserver.port=8080 -Dcsp.sentinel.dashboard.server=localhost:8080 -Dproject.name=sentinel-dashboard -jar sentinel-dashboard-1.8.1.jar\n```\n\n启动成功后，访问`http://localhost:8080`，默认登录的用户名和密码都是`sentinel`。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583265474.png)\n### docker方案\n\n```yaml\nversion: \'3\'\nservices:\n  sentinel:\n    image: registry.cn-hangzhou.aliyuncs.com/zhengqing/sentinel-dashboard:1.8.2\n    container_name: sentinel                                     # 容器名为\'sentinel\'\n    restart: unless-stopped                                      # 指定容器退出后的重启策略为始终重启，但是不考虑在Docker守护进程启动时就已经停止了的容器\n    environment:                                                 # 设置环境变量,相当于docker run命令中的-e\n      TZ: Asia/Shanghai\n      LANG: en_US.UTF-8\n    ports:                                                       # 映射端口\n      - \"8858:8858\"\n\n```\n\n启动成功后，访问`http://localhost:8858`，默认登录的用户名和密码都是`sentinel`。\n\n### \n\n登录进去之后，可以看到主页面，有许多功能菜单，这里就不一一介绍了。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583275979.png)\n## 客户端接入控制台\n\n### 佬的方案（我尝试了一下，结果CommonFilter这个类不存在，不知道为什么）\n\n那么我们自己的应用怎么接入到控制台，使用控制台对应用的流量进行监控呢，诸位客官，请继续往下看。\n\n首先添加maven依赖，客户端需要引入 Transport 模块来与 Sentinel 控制台进行通信。\n\n```xml\n<dependency>\n    <groupId>com.alibaba.csp</groupId>\n    <artifactId>sentinel-transport-simple-http</artifactId>\n    <version>1.8.1</version>\n</dependency>\n```\n\n配置filter，把所有访问的 Web URL 自动统计为 Sentinel 的资源。\n\n```\n@Configuration\npublic class FilterConfig {\n    @Bean\n    public FilterRegistrationBean sentinelFilterRegistration() {\n        FilterRegistrationBean<Filter> registration = new FilterRegistrationBean<>();\n        registration.setFilter(new CommonFilter());\n        registration.addUrlPatterns(\"/*\");\n        registration.setName(\"sentinelFilter\");\n        registration.setOrder(1);\n\n        return registration;\n    }\n}\n```\n\n在启动命令中加入以下配置，`-Dcsp.sentinel.dashboard.server=consoleIp:port` 指定控制台地址和端口，`-Dcsp.sentinel.api.port=xxxx` 指定客户端监控 API 的端口(默认是8019，因为控制台已经使用了8719，应用端为了防止冲突就使用8720)：\n\n```\n-Dserver.port=8888 -Dcsp.sentinel.dashboard.server=localhost:8080 -Dcsp.sentinel.api.port=8720 -Dproject.name=sentinelDemo\n```\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583297414.png)\n### 我的方案\n\nmaven\n\n```xml\n<dependencies>\n\n        <dependency>\n            <groupId>org.springframework.boot</groupId>\n            <artifactId>spring-boot-starter-test</artifactId>\n            <scope>test</scope>\n        </dependency>\n\n        <dependency>\n            <groupId>org.springframework.boot</groupId>\n            <artifactId>spring-boot-starter-web</artifactId>\n        </dependency>\n\n        <dependency>\n            <groupId>com.alibaba.cloud</groupId>\n            <artifactId>spring-cloud-starter-alibaba-sentinel</artifactId>\n        </dependency>\n\n    </dependencies>\n\n    <dependencyManagement>\n        <dependencies>\n            <dependency>\n                <groupId>org.springframework.boot</groupId>\n                <artifactId>spring-boot-dependencies</artifactId>\n                <version>2.1.5.RELEASE</version>\n                <type>pom</type>\n                <scope>import</scope>\n            </dependency>\n            <dependency>\n                <groupId>com.alibaba.cloud</groupId>\n                <artifactId>spring-cloud-alibaba-dependencies</artifactId>\n                <version>2.1.0.RELEASE</version>\n                <type>pom</type>\n                <scope>import</scope>\n            </dependency>\n        </dependencies>\n    </dependencyManagement>\n```\n\nyml\n\n```yml\nserver:\n  port: 8080\nspring:\n  application:\n    name: sentinel-demo\n  cloud:\n    sentinel:\n      transport:\n        dashboard: localhost:8858\n        port: 8858\n```\n\n### 启动项目\n\n我们可以看到多了一个应用名称sentinelDemo，点击机器列表，查看健康状况。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583309666.png)\n请求`/user/list`接口，然后我们可以看到实时监控的接口的QPS情况。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583319536.png)\n这样就代表客户端接入控制台成功了！\n\n## 动态规则\n\nSentinel 的理念是开发者只需要关注资源的定义，当资源定义成功后可以动态增加各种流控降级规则。Sentinel 提供两种方式修改规则：\n\n* 通过 API 直接修改 (`loadRules`)\n* 通过 `DataSource` 适配不同数据源修改\n\n手动通过API定义规则，前面Hello World的例子已经写过，是一种硬编码的形式，因为不够灵活，所以肯定不能应用于生产环境。\n\n所以要引入`DataSource`，规则设置可以存储在数据源中，通过更新数据源中存储的规则，推送到Sentinel规则中心，客户端就可以实时获取最新的规则，根据最新的规则进行限流、降级。\n\n一般`DataSource`拓展常见的实现方式有：\n\n* 拉模式：**客户端主动向某个规则管理中心定期轮询拉取规则**，这个规则中心可以是SQL、文件等。优点是比较简单，缺点是无法及时获取变更。\n* 推模式：规则中心统一推送，客户端通过注册监听器的方式时刻监听变化，比如使用Nacos、Zookeeper 等配置中心。这种方式有更好的实时性和一致性保证，比较推荐使用这种方式。\n\n### 拉模式\n\npull模式的数据源一般是可写入的(比如本地文件)。首先要在客户端注册数据源，将对应的读数据源注册至对应的 RuleManager；然后将写数据源注册至 transport 的 `WritableDataSourceRegistry` 中。\n\n由此看出这是一个双向读写的过程，我们既可以在应用本地直接修改文件来更新规则，也可以通过 Sentinel 控制台推送规则。下图为控制台推送规则的流程图。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583330614.png)\n首先引入maven依赖。\n\n```\n<dependency>\n    <groupId>com.alibaba.csp</groupId>\n    <artifactId>sentinel-datasource-extension</artifactId>\n    <version>1.8.1</version>\n</dependency>\n```\n\n使用SPI机制进行扩展，创建一个实现类，实现InitFunc接口的init()方法。\n\n```\npublic class FileDataSourceInit implements InitFunc {\n\n    public FileDataSourceInit() {\n    }\n\n    @Override\n    public void init() throws Exception {\n        String filePath = System.getProperty(\"user.home\") + \"\\\\sentinel\\\\rules\\\\sentinel.json\";\n        ReadableDataSource<String, List<FlowRule>> ds = new FileRefreshableDataSource<>(\n            filePath, source -> JSON.parseObject(source, new TypeReference<List<FlowRule>>() {\n            })\n        );\n        // 将可读数据源注册至 FlowRuleManager.\n        FlowRuleManager.register2Property(ds.getProperty());\n\n        WritableDataSource<List<FlowRule>> wds = new FileWritableDataSource<>(filePath, this::encodeJson);\n        // 将可写数据源注册至 transport 模块的 WritableDataSourceRegistry 中.\n        // 这样收到控制台推送的规则时，Sentinel 会先更新到内存，然后将规则写入到文件中.\n        WritableDataSourceRegistry.registerFlowDataSource(wds);\n    }\n\n    private <T> String encodeJson(T t) {\n        return JSON.toJSONString(t);\n    }\n}\n```\n\n在项目的 `resources/META-INF/services` 目录下创建文件，名为`com.alibaba.csp.sentinel.init.InitFunc` ，内容则是FileDataSourceInit的全限定名称：\n\n```\nio.github.yehongzhi.springmvc.config.FileDataSourceInit\n```\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583343089.png)\n接着在${home}目录下，创建`\\sentinel\\rules`目录，再创建sentinel.json文件。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583351650.png)\n然后启动项目，发送请求，当客户端接收到请求后就会触发初始化操作。初始化完成后我们到控制台，然后设置流量限流规则。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583359364.png)\n新增后，本地文件`sentinel.json`同时也保存了规则内容（压缩成一行的json）。\n\n```\n[{\"clusterConfig\":{\"acquireRefuseStrategy\":0,\"clientOfflineTime\":2000,\"fallbackToLocalWhenFail\":true,\"resourceTimeout\":2000,\"resourceTimeoutStrategy\":0,\"sampleCount\":10,\"strategy\":0,\"thresholdType\":0,\"windowIntervalMs\":1000},\"clusterMode\":false,\"controlBehavior\":0,\"count\":3.0,\"grade\":1,\"limitApp\":\"default\",\"maxQueueingTimeMs\":500,\"resource\":\"userList\",\"strategy\":0,\"warmUpPeriodSec\":10}]\n```\n\n我们可以通过修改文件来更新规则内容，也可以通过控制台推送规则到文件中，这就是拉模式。缺点是不保证一致性，实时性不保证，拉取过于频繁也可能会有性能问题。\n\n### 推模式\n\n刚刚说了拉模式实时性不能保证，推模式就解决了这个问题。除此之外还可以持久化，也就是数据保存在数据源中，即使重启也不会丢失之前的配置，这也解决了原始模式存在内存中不能持久化的问题。\n\n可以和Sentinel配合使用的数据源有很多种，比如ZooKeeper，Nacos，Apollo等等。这里介绍使用Nacos的方式。\n\n首先要启动Nacos服务器，然后登录到Nacos控制台，添加一个命名空间，添加配置。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583369177.png)\n接着我们就要改造Sentinel的源码。因为官网提供的Sentinel的jar是原始模式的，所以需要改造，所以我们需要拉取源码下来改造一下，然后自己编译jar包。\n\n> 源码地址：[https://github.com/alibaba/Sentinel](https://github.com/alibaba/Sentinel)\n\n拉取下来之后，导入到IDEA中，然后我们可以看到以下目录结构。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583380989.png)\n首先修改sentinel-dashboard的`pom.xml`文件：\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583389072.png)\n第二步，把test目录下的四个关于Nacos关联的类，移到rule目录下。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583399591.png)\nFlowRuleNacosProvider和FlowRuleNacosPublisher不需要怎么改造，本人不太喜欢名称后缀，所以去掉了后面的后缀。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583409341.png)\n接着NacosConfig添加Nacos的地址配置。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583418040.png)\n最关键的是FlowControllerV1的改造，这是规则配置的增删改查的一些接口。\n\n把移动到rule目录下的两个服务，添加到FlowControllerV1类中。\n\n```\n@Autowired\n@Qualifier(\"flowRuleNacosProvider\")\nprivate DynamicRuleProvider<List<FlowRuleEntity>> ruleProvider;\n@Autowired\n@Qualifier(\"flowRuleNacosPublisher\")\nprivate DynamicRulePublisher<List<FlowRuleEntity>> rulePublisher;\n```\n\n添加私有方法publishRules()，用于推送配置：\n\n```\nprivate void publishRules(/*@NonNull*/ String app) throws Exception {\n    List<FlowRuleEntity> rules = repository.findAllByApp(app);\n    rulePublisher.publish(app, rules);\n}\n```\n\n修改apiQueryMachineRules()方法。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583432184.png)\n\n修改apiAddFlowRule()方法。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583440434.png)\n修改apiUpdateFlowRule()方法。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583448419.png)\n修改apiDeleteFlowRule()方法。\n\nSentinel控制台的项目就改造完成了，用于生产环境就编译成jar包运行，如果是学习可以直接在IDEA运行。\n\n我们在前面创建的HelloWord工程的pom.xml文件加上依赖。\n\n```\n<dependency>\n    <groupId>com.alibaba.csp</groupId>\n    <artifactId>sentinel-datasource-nacos</artifactId>\n    <version>1.8.1</version>\n</dependency>\n```\n\n然后在application.yml文件加上以下配置：\n\n```\nspring:\n  cloud:\n    sentinel:\n      datasource:\n        flow:\n          nacos:\n            server-addr: localhost:8848\n            namespace: 05f447bc-8a0b-4686-9c34-344d7206ea94\n            dataId: springmvc-sentinel-flow-rules\n            groupId: SENTINEL_GROUP\n            # 规则类型，取值见：\n            # org.springframework.cloud.alibaba.sentinel.datasource.RuleType\n            rule-type: flow\n            data-type: json\n  application:\n    name: springmvc-sentinel-flow-rules\n```\n\n以上就完成了全部的配置和改造，启动Sentinel控制台，还有Java应用。\n\n打开Nacos控制台，我们添加限流配置如下：\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583458100.png)\n配置内容如下：\n\n```\n[{\"app\":\"springmvc-sentinel-flow-rules\",\"clusterConfig\":{\"acquireRefuseStrategy\":0,\"clientOfflineTime\":2000,\"fallbackToLocalWhenFail\":true,\"resourceTimeout\":2000,\"resourceTimeoutStrategy\":0,\"sampleCount\":10,\"strategy\":0,\"thresholdType\":0,\"windowIntervalMs\":1000},\"clusterMode\":false,\"controlBehavior\":0,\"count\":1.0,\"grade\":1,\"limitApp\":\"default\",\"maxQueueingTimeMs\":500,\"resource\":\"userList\",\"strategy\":0,\"warmUpPeriodSec\":10},{\"app\":\"springmvc-sentinel-flow-rules\",\"clusterConfig\":{\"acquireRefuseStrategy\":0,\"clientOfflineTime\":2000,\"fallbackToLocalWhenFail\":true,\"resourceTimeout\":2000,\"resourceTimeoutStrategy\":0,\"sampleCount\":10,\"strategy\":0,\"thresholdType\":0,\"windowIntervalMs\":1000},\"clusterMode\":false,\"controlBehavior\":0,\"count\":3.0,\"grade\":1,\"limitApp\":\"default\",\"maxQueueingTimeMs\":500,\"resource\":\"queryUserByUserName\",\"strategy\":0,\"warmUpPeriodSec\":10}]\n```\n\n然后我们打开Sentinel控制台，能看到配置，证明Nacos的配置推送成功了。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583466694.png)\n我们尝试调用Java应用的接口，测试是否生效。\n![image](assets/image-20231003200205-cw1aglr.png)\n可以看到限流是生效的，再看看Sentinel监控的QPS情况。\n![image](assets/image-20231003200212-mcfyag3.png)\n从QPS监控的情况看，最高的QPS只有3，其他请求都被拒绝了，证明限流配置是实时生效的。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583491615.png)\n配置信息也被持久化到Nacos相关的配置表中。\n\n这时候，再回头看Sentinel官网上关于推模式的架构图就比较清楚了。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715583500060.png)\n',1,'2024-03-14 12:09:10','2024-04-14 08:12:15'),('61b70650a2d24dcb8ade16cb2289c597','qweqweqwe',0,'2024-06-24 04:19:05','2024-06-24 03:55:37'),('650fe6d0a99c44b69b4c9d15868c6469','## 依赖环境（screen是执行那种一个进程内部需要输入的情况的，另一个不用讲）\n\n`yum install screen unzip`\n## 泰拉瑞亚服务端（根据客户端版本挑吧，虽然没试版本不同行不行）\n[Server - Terraria Wiki (fandom.com)](https://terraria.fandom.com/wiki/Server#Downloads)\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710556312724.png)\n这里有个1.4.4.9版本\n[terraria-server-1449-20231124103121-qpks7sp.zip](http://127.0.0.1:9002/pplax-blogblog/attach/2024-03-16/1710556361825.zip)\n## 启动\n\n解压下载的服务端后进入`Linux`目录执行命令\n\n```bash\n./TerrariaServer.bin.x86_64\n```\n\n这样是前台，好像不能通过`bg`那种方式放到后台\n\n使用这种方式\n\n```bash\nscreen -S tr 				 # 创建面板\n./TerrariaServer.bin.x86_64  # 启动\nctrl+a+d   					 # 保留当前窗口退出\n```\nscreen相关命令看这个[Linux——让程序在后台运行（四种方法+使用推荐）_linux 后台运行_Pan_peter的博客-CSDN博客](https://blog.csdn.net/Pan_peter/article/details/128875714)\n## 后续\n\n上传本地世界到服务器\n\n在本地找到你的世界，路径一般在`C:\\Users\\you\\Documents\\My Games\\Terraria\\Worlds`\n\n如果找不到就从steam云存档里找，如果你放到云存档中，本地就没了\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710556395583.png)\n放到最后一行中指定的目录就行\n\n如果没错的话，这个目录固定是`/root/.local/share/Terraria/Worlds`',1,'2024-03-16 02:33:24','2024-03-16 02:33:24'),('699071efe3ce4df5add4089e1adc5994','### 三级标题<video height=100% width=100% controls autoplay src=\"http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-14/1710409803557.mp4\"></video>',1,'2024-03-14 09:27:16','2024-03-14 09:27:16'),('7685a04ed83c44818474e031dacba3b8','dasasdasd',1,'2024-06-24 04:23:44','2024-06-24 04:23:44'),('771690201d694446b653b9f6a9eabbaf','前言：\n\n总结自视频https://www.youtube.com/watch?v=o2T8259HCfU\n\nyoutuber的twitter：https://twitter.com/shengxj1\n\n![](https://f0gveubr9me.feishu.cn/space/api/box/stream/download/asynccode/?code=YmYzOWIwMjg4MzM0YjA5MWFkOTg4ODdlOWVjMTEzYThfVWxGQlRDN25WbUpvMUQxQTJPMEJUdWx2bVNTbWJiWmtfVG9rZW46RDdvUWJlU1Vpb2RmRGx4YkRqdWMxTXZqblhnXzE2OTEyOTI1OTU6MTY5MTI5NjE5NV9WNA)\n\n国外面试考察内容与国内区别较大，相对于国内的八股文，国外喜欢问架构相关的问题、如设计一个Facebook。\n\n算法能力是哪里也要考的，多刷力扣https://leetcode.cn/，建议刷200+\n\n### 1.\n\neleduck.com（电鸭）\n\n![](https://f0gveubr9me.feishu.cn/space/api/box/stream/download/asynccode/?code=ODJiNWFiM2Y4NWE5N2RlYzc2NTU3Nzg1NWM4OWVmYzVfeE5CMWxqRFhza3VDczN4UXpHTXY3RVZQZklVOU11TWlfVG9rZW46RVVKaGJ6YlRNb1RlRWZ4TEFqVmNSSGloblczXzE2OTEyOTI1OTU6MTY5MTI5NjE5NV9WNA)\n\nwww.linkedin.com（领英国际版，要开全局魔法，要不然会跳转到.cn）\n\n![](https://f0gveubr9me.feishu.cn/space/api/box/stream/download/asynccode/?code=ODViMDY3ZGZjZjlmYWI3ZGJkMTMyY2Y2MzU2ZDRlMThfck03UEJ5SkdobXkyR05ZWElZUnlBbG9saVNhMU14cTdfVG9rZW46UGZ4VGJQT2Zzb1BERWR4ZWpKa2NSRE1kbjhnXzE2OTEyOTI1OTU6MTY5MTI5NjE5NV9WNA)\n\n### 2.前端\n\nvuejobs.com\n\nhttps://javascriptjob.xyz\n\n### 3.远程\n\nremoteok.com\n\nhttps://abetterweb3.notion.site/（web3）\n\nhttps://bolejobs.co/ （Web3 、 Crypto）\n\n### 4.\n\nhttps://justjoin.it/（欧洲平台 网站中筛选教方便）\n\ntoptal.com（高端平台）\n\n### 5.一般是中小型公司发布任务的网站\n\nhttps://wellfound.com/\n\nhttps://startup.jobs/\n\nwww.angellist.com\n\nupwork.com（外包、电鸭有相关帖子）',1,'2024-01-15 07:53:59','2024-01-15 07:53:59'),('7dd7ab3a48984550a596f483178442f0','123456',1,'2024-03-14 09:18:29','2024-03-14 09:18:29'),('806c25dec22740919e4ece051bdb44f0','123',1,'2024-05-06 10:01:46','2024-05-06 10:01:46'),('819e9308cdd843ac8b5dddfe4ded70ca','## vmware\n安装后没有显示虚拟网卡\n\n有个原因是因为原来安装过，但是卸载没卸干净\n\n可以使用everthing删除所有VMware相关的文件\n\n然后使用ccleaner修复注册表\n\n最后重新安装即可\n\n## git\n既然配置了ssh公私钥，那么走的就是ssh，推拉项目的时候不要使用https之类的，踩好几回坑了\n\n## Linux\nredis在存取的时候可能会因为两端时间相差大而出现异常，需要校正时间\n\n如下\n\n```bash\napt install ntpdate\nntpdate cn.pool.ntp.org\n```\n\n## 后端\n### RabbitMQ 报错：connection error； （reply-code=530, reply-text=NOT_ALLOWED - XXX(Hosts名)  not found）\n在 web 管理页面中添加一个 `Name` 为 “`/`” 的 `Host`\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715584025157.png)\n\n### nacos注入失败Could not resolve placeholder ‘xxx’ in value ‘${xxx}’\n顶级巨坑\n\n配置data-id的时候要注意这个\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715584069392.png)\n\n在nacos控制台上配置格式光是yaml还不行，还得带上扩展名，无语了啊\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-05-13/1715584076992.png)\n\n### spring-boot上传文件MultiPartFile获取不到文件问题解决\n原因是：[spring](https://www.codeprj.com/link/aHR0cDovL2xpYi5jc2RuLm5ldC9iYXNlL2phdmFlZQ== \"Java EE知识库\")-boot自带的`org.springframework.web.multipart.MultipartFile`\n和`Multipart`产生冲突，如果同时使用了`MultipartResolver`和`ServletFileUpload`，就会在`iter.hasNext()`返回`false`.然后整个循环就跳出去了。整个问题产生的原因是`Spring`框架先调用了`MultipartResolver` 来处理`http multi-part`的请求。这里`http multipart`的请求已经消耗掉。后面又交给`ServletFileUpload` ，那么`ServletFileUpload` 就获取不到相应的`multi-part`请求。因此将`multipartResolve`配置去除，问题就解决了。\n\n\n单文件的话只需要一个变量即，多文件上传的话就将`MultipartFile`改为数组，然后分别上传保存即可。\n\n### MySQl连接报错\n1. No appropriate protocol (protocol is disabled or cipher suites are inappropriate\n\n    添加参数\n\n    `?createDatabaseIfNotExist=true&useSSL=false`\n2. The last packet sent successfully to the server was 0 milliseconds ago. The driver has not received any packets from the server. Communications link failure\n\n    这是端口错了，看看配置的启动端口是哪个\n',1,'2024-03-14 12:09:09','2024-04-14 08:12:16'),('9486d2aecd31440fab53174aa34f3f43','dffadsfadsadfs',0,'2024-06-24 04:22:07','2024-06-24 04:13:52'),('99d2f7feedd6452b88a1c686038b03c4','qweqweqwe',0,'2024-06-24 04:18:34','2024-06-24 03:55:37'),('9d4882479baf4a5e93396ac365636605','### **使用dd命令创建一个swap交换文件**\n\n```bash\ndd if=/dev/zero of=/home/swap bs=1024 count=1024000 	#  这是创建了1G\n```\n\n### **制作为swap格式文件**\n\n```bash\nmkswap /home/swap\n```\n\n### **挂载swap分区**\n\n```bash\nswapon /home/swap\n```\n\n### 开机自动挂载\n\n```bash\nvim /etc/fstab \n```\n\n文件末尾添加\n\n`/home/swap swap swap default 0 0`',1,'2024-03-16 02:11:03','2024-03-16 02:11:03'),('9ddd597bb3ff4426b84f35439f553e94','这是文章内容',1,'2024-01-15 07:48:34','2024-01-15 07:48:34'),('a5c69681d9cd45c2b5bc471460dc619e','哇',1,'2024-04-22 04:00:03','2024-04-22 04:00:03'),('ad741f1e3d6d485fb2fbf78e704bc95b','qweqweqwe',0,'2024-06-24 04:18:33','2024-06-24 03:55:37'),('afa22a4ffa7e41de99863f16ab3e5c97','扇形火狠狠登',1,'2024-01-15 07:52:28','2024-01-15 07:52:28'),('c8f484a1797843728ec175418e38b68c','qweqweqwe',0,'2024-06-24 04:18:35','2024-06-24 03:55:37'),('d0000508a7284ff4a41c6ca1c0396138','qweqweqwe',0,'2024-06-24 04:18:35','2024-06-24 03:55:37'),('d4676f79727e497db32725b4101beee9','dffadsfadsadfs',0,'2024-06-24 04:22:08','2024-06-24 04:13:52'),('d7ec17e36f264d4c89f146fb400c948e','dffadsfadsadfs',0,'2024-06-24 04:22:07','2024-06-24 04:13:52'),('dd89d2f387254183ba3896054ceb616b','dffadsfadsadfs',0,'2024-06-24 04:22:07','2024-06-24 04:13:52'),('e126b32bae5e45bfbb60cff9c2a08a2d','`docker images`\n\n`docker ps`\n\n\n#### 关闭容器\n\n`docker stop f66`\n\n#### 删除镜像\n\n`docker rmi df1`\n\n\n\n\n## **停止、删除所有的docker容器和镜像**\n\n**启动所有容器**\n\n```bash\ndocker start $(docker ps -a | awk \'{ print $1 }\' | tail -n +2)\n```\n\n**列出所有的容器 IDs**\n\n```bash\ndocker ps -aq\n```\n\n**停止所有的容器**\n\n```bash\ndocker stop $(docker ps -aq)\n```\n\n**删除所有的容器**\n\n```bash\ndocker rm $(docker ps -aq)\n```\n\n**删除所有的镜像**\n\n```bash\ndocker rmi $(docker images -q)\n```\n\n现在的docker有了专门清理资源(container、image、网络)的命令。 docker 1.13 中增加了 `docker system prune`的命令，针对container、image可以使用`docker container prune`、`docker image prune`命令。\n\n\n删除所有不使用的镜像\n\n```bash\ndocker image prune --force --all\n```\n\n```bash\ndocker image prune -f -a\n```\n\n删除所有停止的容器\n\n```bash\ndocker container prune -f\n```\n\n\n\n向容器内复制文件\n\n```bash\ndocker cp file.conf seata-docker_seata-server_1:/root/seata-config/\n# docker cp 主机的文件名 容器名/id:容器内的目标路径\n```\n\n\n进入命令行\n\n```bash\n docker exec -it rabbitmq bash\n```',1,'2024-03-16 02:09:57','2024-03-16 02:09:57'),('f6121ceeb0bf47939e2097760b0d8f40','在此之前需要将路由器固件刷为旧版，此版本为漏洞版本，可以通过url注入实现ssh通信\n\n刷机/救砖工具\n[MIWIFIRepairTool.x86-20240113165004-91abemk.zip](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710555354502.zip)\n旧版原生固件\n[miwifi_rm2100_firmware_d6234_2.0.7-20240113165113-96knvmu.bin](http://127.0.0.1:9002/pplax-blogblog/attach/2024-03-16/1710555757456.bin)\n### url注入，开启ssh\n浏览器访问`192.168.31.1`，输入账号密码登录\n复制`stok`字段\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710555806743.png)\n浏览器访问如下链接，用于开启ssh\n\n```url\nhttp://192.168.31.1/cgi-bin/luci/;stok=<STOK>/api/misystem/set_config_iotdev?bssid=Xiaomi&user_id=longdike&ssid=-h%3B%20nvram%20set%20ssh_en%3D1%3B%20nvram%20commit%3B%20sed%20-i%20\'s%2Fchannel%3D.*%2Fchannel%3D%5C%22debug%5C%22%2Fg\'%20%2Fetc%2Finit.d%2Fdropbear%3B%20%2Fetc%2Finit.d%2Fdropbear%20start%3B\n```\n\n将其中的`<STOK>`修改为复制的stok\n\n返回`{\"code\":0`表示成功\n浏览器访问如下链接，用于修改密码\n\n```text\nhttp://192.168.31.1/cgi-bin/luci/;stok=<STOK>/api/misystem/set_config_iotdev?bssid=Xiaomi&user_id=longdike&ssid=-h%3B%20echo%20-e%20\'admin%5Cnadmin\'%20%7C%20passwd%20root%3B\n```\n\n将其中的`<STOK>`修改为复制的stok\n\n返回`{\"code\":0`表示成功，此时用户名为`root`，密码为`admin`\nssh登录，ip为`192.168.31.1`\n\n登录成功是这样的\n\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710555870249.png)\n### 刷入breed\n\n固件\n[breed-mt7621-xiaomi-r3g-20240113165130-ushhyyp.bin](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710555915412.bin)\n这个文件传入到路由器中\n\n执行如下命令，`/tmp/breed-mt7621-xiaomi-r3g.bin`替换为对应文件\n\n```bash\nmtd -r write /tmp/breed-mt7621-xiaomi-r3g.bin Bootloader\n```\n执行完成后等待自动重启，路由器转为蓝灯后，breed刷入成功\n### 刷入openwrt\n\n固件\n[原版openwrt-20240113170039-shh47yc.7z](http://127.0.0.1:9002/pplax-blogblog/attach/2024-03-16/1710555969929.7z)\n浏览器访问`192.168.1.1`环境变量添加字段`xiaomi.r3g.bootfw`,值设置为2 。\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710555988170.png)\n选择固件更新，进行如下选择，点击上传\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710555998354.png)\n点击更新\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710556008158.png)\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710556013402.png)\n路由器重启，蓝灯常亮，浏览器访问`192.168.1.1`\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710556024026.png)\n账号`root` 密码`admin`\n\n刷完了\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710556034983.png)\n### 备份/升级\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710556051527.png)\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710556055526.png)\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710556059632.png)\n### 打开无线网\n\nopenwrt默认关闭wireless，需要手动打开\n![image.png](http://127.0.0.1:9002/pplax-blog/blog/attach/2024-03-16/1710556071535.png)\n### 小米特供版openwrt\n[特供版小米openwrt固件-20240115121122-1fplwn6.7z](http://127.0.0.1:9002/pplax-blogblog/attach/2024-03-16/1710556095550.7z)\n',1,'2024-03-14 09:16:55','2024-03-14 09:16:55'),('f8552d918da146bda992a1031266dad1','# 安装\n\n## 1 国内镜像秒下载\n\n```\ncurl -L https://get.daocloud.io/docker/compose/releases/download/1.25.5/docker-compose-`uname -s`-`uname -m`  > /usr/local/bin/docker-compose\n```\n\n官方（如果时间充裕就用这个，国内的老出问题）\n\n```bash\ncurl -L \"https://github.com/docker/compose/releases/download/1.29.2/docker-compose-$(uname -s)-$(uname -m)\" -o /usr/local/bin/docker-compose\n```\n\n* 如果遇到版本更新，把版本数字更改一下就可以了。\n\n## 2 修改文件执行权限\n\n```\nsudo chmod +x /usr/local/bin/docker-compose\n```\n\n## 3 创建软链\n\n```\nsudo ln -s /usr/local/bin/docker-compose /usr/bin/docker-compose\n```\n\n\n\n\n\n```yaml\ndocker-compose -f docker-compose.yaml up\n```',1,'2024-03-16 02:09:43','2024-03-16 02:09:43');
