--
-- Table structure for table `t_message`
--

DROP TABLE IF EXISTS `t_message`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `t_message` (
  `uid` varchar(32) NOT NULL COMMENT '唯一uid',
  `user_uid` varchar(32) DEFAULT NULL COMMENT '用户uid，如果为空则代表游客发言',
  `chat_room_uid` varchar(32) DEFAULT NULL COMMENT '聊天室uid',
  `content` mediumtext COMMENT '留言内容',
  `read_user_uids` varchar(1024) DEFAULT NULL COMMENT '已读用户列表，存储已读用户的uid，多个用户用逗号分隔',
  `ip` varchar(50) DEFAULT '127.0.0.1' COMMENT '留言ip',
  `address` varchar(256) DEFAULT '未知' COMMENT '留言地址',
  `type` int NOT NULL COMMENT '类型 0留言消息 1聊天消息',
  `status` tinyint unsigned NOT NULL DEFAULT '1' COMMENT '状态',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COMMENT='消息表';
/*!40101 SET character_set_client = @saved_cs_client */;

